import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      value : 0,
      result : 0
    }
  }

  clickNum =(num)=>() =>{ 
    this.setState({ 
    value : this.state.value*10 + num   }); 
  }

  render() {
    return (
      <div className="App">

        <div className="same">
          <div className="typing"> {this.state.value}</div>
          <div className="main">
            <div className="flex">
              <div className="first_three">AC</div>
              <div className="first_one">/</div>
            </div>

            <div className="flex">
              <div onClick={this.clickNum(7)} className="rest_one">7</div>
              <div className="rest_one">8</div>
              <div className="rest_one">9</div>
              <div className="rest_one">*</div>
            </div>

            <div className="flex">
              <div className="rest_one">4</div>
              <div className="rest_one">5</div>
              <div className="rest_one">6</div>
              <div className="rest_one">-</div>
            </div>

            <div className="flex">
              <div className="rest_one">1</div>
              <div className="rest_one">2</div>
              <div className="rest_one">3</div>
              <div className="rest_one">+</div>
            </div>

            <div className="flex">
              <div className="rest_two">0</div>
              <div className="rest_one">.</div>
              <div className="rest_one">=</div>
            </div>
          </div>
        </div>

      </div>
    );
  }
}

export default App;
